const admin = require('firebase-admin');

const { decrypt } = require('./encryption');

const keys = {
  'vota-campina-grande-prod':
    '',
  'vota-campinas-prod':
    '',
  'vota-jampa-prod':
    '',
  'vota-porto-alegre-prod':
    '',
  'vota-recife-prod':
    '',
  'vota-americana-prod':
    '',

  'vota-campina-grande-dev':
    '',
  'vota-campinas-dev':
    '',
  'vota-jampa-dev':
    '',
  'vota-porto-alegre-dev':
    '',
  'vota-recife-dev':
    '',
  'vota-americana-dev':
    '',
};

const firebaseInstances = Object.keys(keys).reduce(
  (instances, key) => ({
    ...instances,
    [key]: () =>
      admin.initializeApp(
        {
          databaseURL: `https://${key}.firebaseio.com`,
          credential: admin.credential.cert(decrypt(keys[key])),
        },
        Date.now().toString(),
      ),
  }),
  {},
);

module.exports = {
  firebaseInstances,
};
